import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Badge,
  Button,
  Box,
  Container,
  InputBase,
  useTheme,
  useMediaQuery,
} from '@mui/material';
import {
  Search as SearchIcon,
  ShoppingCart as CartIcon,
  AccountCircle as AccountIcon,
  Menu as MenuIcon,
  LocationOn as LocationIcon,
} from '@mui/icons-material';
import { styled, alpha } from '@mui/material/styles';
import { useSelector, useDispatch } from 'react-redux';
import { useNavigate } from 'react-router-dom';
import { selectIsAuthenticated, selectUser } from '../store/slices/authSlice';
import { selectCartItemCount, toggleCart } from '../store/slices/cartSlice';
import { toggleSidebar, openModal } from '../store/slices/uiSlice';

const Search = styled('div')(({ theme }) => ({
  position: 'relative',
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha(theme.palette.common.white, 0.15),
  '&:hover': {
    backgroundColor: alpha(theme.palette.common.white, 0.25),
  },
  marginLeft: 0,
  marginRight: theme.spacing(2),
  width: '100%',
  [theme.breakpoints.up('sm')]: {
    marginLeft: theme.spacing(1),
    width: 'auto',
  },
}));

const SearchIconWrapper = styled('div')(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: '100%',
  position: 'absolute',
  pointerEvents: 'none',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: 'inherit',
  width: '100%',
  '& .MuiInputBase-input': {
    padding: theme.spacing(1, 1, 1, 0),
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create('width'),
    [theme.breakpoints.up('sm')]: {
      width: '12ch',
      '&:focus': {
        width: '20ch',
      },
    },
  },
}));

const Logo = styled(Typography)(({ theme }) => ({
  flexGrow: 0,
  fontWeight: 700,
  color: theme.palette.primary.main,
  textDecoration: 'none',
  cursor: 'pointer',
  display: 'flex',
  alignItems: 'center',
  '& .logo-emoji': {
    marginRight: theme.spacing(1),
    fontSize: '1.5rem',
  },
}));

const Header = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));
  const dispatch = useDispatch();
  const navigate = useNavigate();
  
  const isAuthenticated = useSelector(selectIsAuthenticated);
  const user = useSelector(selectUser);
  const cartItemCount = useSelector(selectCartItemCount);

  const handleCartClick = () => {
    dispatch(toggleCart());
  };

  const handleProfileClick = () => {
    if (isAuthenticated) {
      dispatch(toggleSidebar('profile'));
    } else {
      dispatch(openModal('login'));
    }
  };

  const handleLogoClick = () => {
    navigate('/');
  };

  const handleLocationClick = () => {
    // TODO: Implement location selection
    console.log('Location clicked');
  };

  const handleMenuClick = () => {
    dispatch(toggleSidebar('menu'));
  };

  return (
    <AppBar position="sticky" color="default" elevation={1}>
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          {/* Mobile Menu Button */}
          {isMobile && (
            <IconButton
              size="large"
              edge="start"
              color="inherit"
              aria-label="menu"
              onClick={handleMenuClick}
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
          )}

          {/* Logo */}
          <Logo variant="h6" onClick={handleLogoClick}>
            <span className="logo-emoji">🍕</span>
            FoodieExpress
          </Logo>

          {/* Location (Desktop) */}
          {!isMobile && (
            <Button
              startIcon={<LocationIcon />}
              onClick={handleLocationClick}
              sx={{ ml: 3, color: 'text.secondary' }}
            >
              Current Location
            </Button>
          )}

          {/* Search Bar (Desktop) */}
          {!isMobile && (
            <Search sx={{ flexGrow: 1, maxWidth: 400, ml: 4 }}>
              <SearchIconWrapper>
                <SearchIcon />
              </SearchIconWrapper>
              <StyledInputBase
                placeholder="Search restaurants, cuisines..."
                inputProps={{ 'aria-label': 'search' }}
              />
            </Search>
          )}

          <Box sx={{ flexGrow: 1 }} />

          {/* Right side buttons */}
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
            {/* Search Icon (Mobile) */}
            {isMobile && (
              <IconButton
                size="large"
                color="inherit"
                aria-label="search"
              >
                <SearchIcon />
              </IconButton>
            )}

            {/* Cart */}
            <IconButton
              size="large"
              color="inherit"
              aria-label="shopping cart"
              onClick={handleCartClick}
            >
              <Badge badgeContent={cartItemCount} color="primary">
                <CartIcon />
              </Badge>
            </IconButton>

            {/* Profile/Login */}
            {isAuthenticated ? (
              <IconButton
                size="large"
                color="inherit"
                aria-label="account"
                onClick={handleProfileClick}
              >
                <AccountIcon />
              </IconButton>
            ) : (
              <Button
                variant="outlined"
                onClick={handleProfileClick}
                sx={{ ml: 1 }}
              >
                Login
              </Button>
            )}
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Header;
